<script>
  import { onMount, onDestroy } from "svelte";

  let hours = 0;
  let minutes = 0;
  let seconds = 0;
  let milliseconds = 0;
  let daysSinceFeb24 = 0;
  let timer;

  const targetDate = new Date("2022-02-24T00:00:00").getTime();

  const updateTime = () => {
  const now = new Date().getTime();
  const diff = now - targetDate;

  // Bereken dagen sinds 24 februari 2022
  daysSinceFeb24 = Math.floor(diff / (1000 * 60 * 60 * 24));

  // Bereken uren, minuten, seconden en milliseconden
  const totalSeconds = Math.floor(diff / 1000);
  hours = Math.floor(totalSeconds / 3600); // Afronden naar een geheel getal
  minutes = Math.floor((totalSeconds % 3600) / 60);
  seconds = totalSeconds % 60;
  milliseconds = diff % 1000;
};



  onMount(() => {
    timer = setInterval(updateTime, 10);

    const IntroSection = document.querySelector(".data-story:nth-of-type(1)");
    const worldSvg = IntroSection.querySelector("svg:nth-of-type(1)");
    const ukraineSvg = IntroSection.querySelector('svg:nth-of-type(2)')
    const firstPart = IntroSection.querySelector("h3:nth-of-type(1)");
    const secondPart = IntroSection.querySelector("h3:nth-of-type(2)");
    const realTimeContainer = IntroSection.querySelector('.conflict');
    const lastPart = document.querySelector('.data-story:nth-of-type(1) > h4')

    const handleScroll = () => {

      if (window.innerWidth < 786){
          if(window.scroll > 300){
            worldSvg.classList.add('fade-out')
          } else {
            worldSvg.classList.remove('fade-out')
          }
      }
      
      // Voor scrollY > 300
      if (window.scrollY > 300) {
        if (!worldSvg.classList.contains("increase")) {
          worldSvg.classList.add("increase");
          ukraineSvg.classList.add('increase')
          firstPart.classList.add("active");
        }
      } else {
        // Bij scrollY < 300, herstel vorige staat
        if (worldSvg.classList.contains("increase")) {
          worldSvg.classList.remove("increase");
          worldSvg.classList.remove("two");
          ukraineSvg.classList.remove('increase')
          firstPart.classList.remove("active");
          secondPart.classList.remove("active");
        }
      }

      // Voor scrollY > 600
      if (window.scrollY > 1200) {
        if (worldSvg.classList.contains("increase") || urkaineSvg.classList.contains('increase')) {
          worldSvg.classList.add("two");
          ukraineSvg.classList.add("two");
          firstPart.classList.remove("active");
          secondPart.classList.add("active");
        }
      } else {
        // Herstel naar 300px, de vorige status
        if (worldSvg.classList.contains("two") || urkaineSvg.classList.contains('two')) {
          worldSvg.classList.remove("two");
          ukraineSvg.classList.remove("two");
          firstPart.classList.add("active");
          secondPart.classList.remove("active");
        }
      }

      // Voor scrollY > 900
      if (window.scrollY > 2400) {
        if (worldSvg.classList.contains("increase") && worldSvg.classList.contains("two") || ukraineSvg.classList.contains("increase") && ukraineSvg.classList.contains("two") ) {
          worldSvg.classList.add("three");
          ukraineSvg.classList.add('three')
          secondPart.classList.remove("active");
          realTimeContainer.classList.add('reveal')
        }
      } else {
        if (worldSvg.classList.contains("increase") && worldSvg.classList.contains("two") || ukraineSvg.classList.contains('increase') && ukraineSvg.classList.contains('two')) {
          worldSvg.classList.remove("three");
          ukraineSvg.classList.remove("three");
          secondPart.classList.add("active");
          realTimeContainer.classList.remove('reveal')
        }
      }
      if (window.scrollY > 3600) {
        // Controleer of zowel 'increase' als 'two' aanwezig zijn voordat 'three' wordt toegevoegd
        if (worldSvg.classList.contains("increase") && worldSvg.classList.contains("two") && worldSvg.classList.contains("three")) {
          worldSvg.classList.add("four");
          lastPart.classList.add('show')
          realTimeContainer.classList.remove("reveal");
        }
      } else {
        if (worldSvg.classList.contains("increase") && worldSvg.classList.contains("two")  && worldSvg.classList.contains("three")) {
          worldSvg.classList.remove("four");
          lastPart.classList.remove('show')
          realTimeContainer.classList.add('reveal')
        }
      }

      if (window.scrollY > 4200){
        if(worldSvg.classList.contains('increase') && worldSvg.classList.contains('two') && worldSvg.classList.contains('three') && worldSvg.classList.contains('four')){
          lastPart.classList.remove('show')
        }
      } else {
        if(worldSvg.classList.contains('increase') && worldSvg.classList.contains('two') && worldSvg.classList.contains('three') && worldSvg.classList.contains('four')){
          lastPart.classList.add('show')
        }
      }

    };

    // Throttling om scroll event niet te veel te activeren
    const throttle = (func, limit) => {
      let inThrottle;
      return function () {
        if (!inThrottle) {
          func.apply(this, arguments);
          inThrottle = true;
          setTimeout(() => (inThrottle = false), limit);
        }
      };
    };

    window.addEventListener("scroll", throttle(handleScroll, 10));

    return () => {
      window.removeEventListener("scroll", throttle(handleScroll, 10));
      clearInterval(timer); 
    };
  });
</script>

